  mounted: function mounted() {
    if (!util.cookies.get('auth')) {
      checkAuth().then(function (res) {}).catch(function (res) {});
    }

    this.getAuth();
  },
  methods: {
    getAuth: function getAuth() {
      var _this = this;

      auth().then(function (res) {
        var data = res.data || {};

        if (data.auth_code && data.auth) {
          _this.authCode = data.auth_code;
          _this.auth = true;
        }
      }).catch(function (res) {});
    }
  }
};
